import React from "react";

export default function HomeCard({temperature}){
    return(
        <div>
            <h1>Nombre {temperature.name}</h1>
            <h2>temperature {temperature.temp}</h2>
            
            <h2>temperature min {temperature.temp_min}</h2>
            <h2>temperature max {temperature.temp_max}</h2>
            <h2>pressure {temperature.pressure}</h2>
            <h2>Humedad {temperature.humidity}</h2>
            <h2>descripcion {temperature.description}</h2>
        </div>
    )
}
